eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('VueRemarkRoot',[_c('LessonImages',{attrs:{\"src\":\"smart-home-intro/open-source-private-smart-home-intro.png\",\"imageClasses\":\"mb full\"}}),_c('RoboAcademyText',[_vm._v(\"\\n  Hallo allemaal! Vandaag wil ik met jullie in gesprek gaan over een slim huis, wanneer er behoefte aan is, waaruit het bestaat en wat het kan bieden.\\n\")]),_c('h2',{attrs:{\"id\":\"slimme-huizen-het-oplossen-van-verwarmings--en-warmwaterproblemen\"}},[_c('a',{attrs:{\"href\":\"#slimme-huizen-het-oplossen-van-verwarmings--en-warmwaterproblemen\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Slimme huizen: Het oplossen van verwarmings- en warmwaterproblemen\")]),_c('p',[_vm._v(\"In 2022 verhuisde ik naar Cyprus en moest ik snel wennen aan de leefomstandigheden op een nieuwe plek. Na Rusland voel je het verschil in houding ten opzichte van het gebruik van energiebronnen extra scherp. Bijvoorbeeld, in Cyprus is er geen centrale verwarming. En tot december hoefde je daar niet aan te denken. En toen bleek dat de temperatuur in mijn slaapkamer hetzelfde is als de temperatuur buiten het raam. Eerlijk gezegd is het ongemakkelijk om te slapen bij +10 С ... brrr!\")]),_c('h2',{attrs:{\"id\":\"verhoog-je-besparingen-met-slimme-huismonitoring\"}},[_c('a',{attrs:{\"href\":\"#verhoog-je-besparingen-met-slimme-huismonitoring\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Verhoog je besparingen met slimme huismonitoring\")]),_c('p',[_vm._v(\"Verder is er ook geen centrale warmwatervoorziening. Er zijn boilers die op het dak zijn geïnstalleerd en worden verwarmd door de zon. Maar in de winter is de zon niet voldoende om de watertank te verwarmen. Het appartement heeft een schakelaar die het verwarmingselement in de tank start. Het eerste ongemak is dat je het van tevoren moet inschakelen. Een half uur tot een uur voordat je gaat douchen. 's Avonds is dit scenario nog acceptabel, maar 's ochtends zul je nooit warm water hebben. Ten tweede kun je het gemakkelijk vergeten uit te zetten. Met als resultaat - een doorgebrand verwarmingselement en een elektriciteitsrekening.\")]),_c('p',[_vm._v(\"Overigens is elektriciteit hier erg duur, en je moet er elke 2 maanden voor betalen. Het is op dit moment onmogelijk om de belangrijkste verbruiker te bepalen. Het zou handig zijn om statistieken te hebben over de belangrijkste elektrische verbruikers, zoals airconditioning, vloerverwarming, verlichting, enz. Met realtime gegevens over het stroomverbruik bij de hand, kun je in ieder geval beginnen met analyseren waar het aan wordt besteed.\")]),_c('h2',{attrs:{\"id\":\"essentiële-componenten-van-een-slim-huis-schakelaars-sensoren-en-slimme-meters\"}},[_c('a',{attrs:{\"href\":\"#essenti%C3%ABle-componenten-van-een-slim-huis-schakelaars-sensoren-en-slimme-meters\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Essentiële componenten van een slim huis: schakelaars, sensoren en slimme meters\")]),_c('p',[_vm._v(\"Het blijkt dat de eerste kandidaten voor slimme apparaten verschillende schakelaars en stroomverbruiksmonitoring zijn. Daarna zul je waarschijnlijk nadenken over het regelen van de airconditioner en vloerverwarming volgens een schema of volgens temperatuurmetingen. Dit betekent dat we temperatuur- en vochtigheidssensoren, relais voor het regelen van vloerverwarming en IR-afstandsbedieningen voor airconditioners nodig zullen hebben. Elk huis heeft ook ramen, en de ramen hebben meestal gordijnen - het zou handig zijn als de gordijnen automatisch sluiten als je naar bed gaat. Zo vormen schakelaars, sensoren en slimme meters de basis van een slim huis. En dan kun je dromen op basis van specifieke behoeften.\")]),_c('h2',{attrs:{\"id\":\"het-kiezen-van-de-juiste-slimme-huisoplossing-knx-vs-sonoff-vs-xiaomi\"}},[_c('a',{attrs:{\"href\":\"#het-kiezen-van-de-juiste-slimme-huisoplossing-knx-vs-sonoff-vs-xiaomi\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Het kiezen van de juiste slimme huisoplossing: KNX vs. Sonoff vs. Xiaomi\")]),_c('p',[_vm._v(\"Welke slimme huis- en automatiseringsoplossingen zijn er op de markt? We kunnen denken aan KNX, dat vandaag de dag een van de meest voorkomende oplossingen is voor gebruik in middelgrote en grote automatiseringssystemen voor woningen, kantoren en commerciële ruimtes. Het is al meer dan twintig jaar op de markt en wordt nu ondersteund door veel grote fabrikanten van elektrische apparatuur. Om echter een KNX-oplossing samen te stellen, moet er veel engineeringwerk worden verricht. De belangrijkste logica wordt doorgaans samengesteld in een apart schakelbord. Als dit niet oorspronkelijk was voorzien, kan installatie in een bestaand appartement moeilijk of zelfs onmogelijk zijn zonder de juiste wijzigingen aan te brengen in de lay-out. Bovendien zijn op KNX gebaseerde oplossingen behoorlijk duur.\")]),_c('p',[_vm._v(\"Een andere benadering zou kunnen zijn om apparaten te kopen van Chinese fabrikanten zoals Sonoff of Xiaomi. Hun belangrijkste voordeel is de prijs, de eenvoud van installatie en configuratie. Iedereen zal de meeste sensoren en apparaten in hun huis kunnen installeren. Op sommige plaatsen heb je misschien een elektricien nodig, bijvoorbeeld om slimme schakelaars te installeren, maar ze zullen de plaats innemen van de oude en je hoeft geen wijzigingen aan te brengen in de lay-out van het appartement. De fabrikant biedt een enkele applicatie voor het beheren van apparaten. Je moet echter altijd onthouden dat je gegevens ergens naartoe worden gestuurd naar de server, en alle communicatie met apparaten is onmogelijk zonder een internetverbinding.\")]),_c('h2',{attrs:{\"id\":\"diy-slim-huis-het-bouwen-van-een-thuisserver-voor-volledige-controle\"}},[_c('a',{attrs:{\"href\":\"#diy-slim-huis-het-bouwen-van-een-thuisserver-voor-volledige-controle\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"DIY slim huis: Het bouwen van een thuisserver voor volledige controle\")]),_c('p',[_vm._v(\"En nog een benadering voor het bouwen van een slim huis is gebaseerd op de tweede, d.w.z. het gebruik van beschikbare apparaten van dezelfde Chinese fabrikanten, maar daarnaast een thuisserver installeren in je appartement / huis om van de clouds af te komen. Dit is de weg die we hebben gekozen in onze slimme huisoplossing. In de volgende delen zal ik gedetailleerd praten over de assemblage van onze demostand en zijn mogelijkheden.\")]),_c('RoboAcademyText',{attrs:{\"fWeight\":\"500\"}},[_vm._v(\"\\n  Dat is alles voor nu! In de volgende les zullen we dieper ingaan op de praktische kant van het bouwen van een slim huis en laten we zien hoe je een Smart Home Board kunt assembleren. Blijf op de hoogte en maak je klaar om je eerste stap te zetten naar het creëren van een volledig functioneel en geautomatiseerd huis.\\n\")])],1)}\nvar staticRenderFns = []\n\n\n\n//# sourceURL=webpack:///./courses/nl/learn/open-source-private-smart-home-intro/overview.md?./node_modules/cache-loader/dist/cjs.js?%7B%22cacheDirectory%22:%22node_modules/.cache/gridsome%22,%22cacheIdentifier%22:%223ec475f9-vue-loader-template%22%7D!./node_modules/gridsome/node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/gridsome/node_modules/vue-loader/lib??ref--17-0!./node_modules/@gridsome/vue-remark/lib/loader.js??ref--17-1");

